Actionscript.script:
攻击时移动 = _root.敌人二级函数.攻击时移动;
X轴追踪移动 = _root.敌人二级函数.X轴追踪移动;
Z轴追踪移动 = _root.敌人二级函数.Z轴追踪移动;
计算攻击角度 = _root.敌人二级函数.计算攻击角度;
固定角度移动 = _root.敌人二级函数.固定角度移动;

gotoAndPlay(_parent.近战招式);

function 普通攻击()
{
	子弹属性 = _root.子弹属性初始化(this.攻击点);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战子弹";
	子弹属性.子弹威力 = _parent.空手攻击力;
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 10;

	子弹属性.区域定位area = this.攻击点;

	_root.子弹区域shoot传递(子弹属性);
}

function 跑动攻击()
{
	子弹属性 = _root.子弹属性初始化(this.攻击点);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战子弹";
	子弹属性.子弹威力 = _parent.空手攻击力;
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 1;

	子弹属性.不硬直 = true;

	子弹属性.区域定位area = this.攻击点;

	_root.子弹区域shoot传递(子弹属性);
}

onClipEvent (load) {
	弧度 = _parent.计算攻击角度(90) * Math.PI / 180;
	速度 = 35;
}
onClipEvent (enterFrame) {
	_parent.X轴追踪移动(80,0,速度 * Math.acos(弧度));
	_parent.Z轴追踪移动(速度 * Math.asin(弧度));
}

onClipEvent (load) {
	角度 = _parent.计算攻击角度(30);
}
onClipEvent (enterFrame) {
	_parent.固定角度移动(25,角度);
}

onClipEvent (load) {
	速度 = 30;
}
onClipEvent (enterFrame) {
	if (速度 > 0)
	{
		_parent.攻击时移动(速度);
		速度 -= 6;
	}
}
